var get_matches = function(json) {

    var sats = new Array(json.details.numGriddedMatched);
    var sits = new Array(json.details.numInSituMatched);
    var sitmap = {};
    var sitnum = 0;
    var links = new Array(json.details.numInSituMatched);
    var source_counts = {};

    strkeys = ['id', 'device', 'source'];
    fltkeys = ['x', 'y', 'time'];

    var linknum = 0;
    for (var i=0; i < json.data.length; i++) {
        sats[i] = {};
        for (var k in strkeys) {
            sats[i][strkeys[k]] = json.data[i][strkeys[k]];
        }
        for (var k in fltkeys) {
            sats[i][fltkeys[k]] = +(json.data[i][fltkeys[k]]);
        }
        sats[i].name = sats[i].id;
        sats[i].group = sats[i].source;
        sats[i].lat = sats[i].y;
        sats[i].lon = sats[i].x;
        source_counts[sats[i].source] = source_counts[sats[i].source] ? source_counts[sats[i].source]+1 : 1;

        for (var m in json.data[i].matches) {
            if (!sitmap[json.data[i].matches[m].id]) {
                sitmap[json.data[i].matches[m].id] = sitnum;
                sits[sitnum] = {};
                for (var k in strkeys) {
                    sits[sitnum][strkeys[k]] = json.data[i].matches[m][strkeys[k]];
                }
                for (var k in fltkeys) {
                    sits[sitnum][fltkeys[k]] = +(json.data[i].matches[m][fltkeys[k]]);
                }
                sits[sitnum].name = sits[sitnum].id;
                sits[sitnum].group = sits[sitnum].source;
                sits[sitnum].lat = sits[sitnum].y;
                sits[sitnum].lon = sits[sitnum].x;
                source_counts[sits[sitnum].source] = source_counts[sits[sitnum].source] ? source_counts[sits[sitnum].source]+1 : 1;
                sitnum += 1;
            }
            links[linknum] = {'source': i, 'target': json.data.length + sitmap[json.data[i].matches[m].id], 'value': 0.3};
            linknum += 1;
        }
    }

    var nodes = sats.concat(sits.slice(0, sitnum));

    console.log('Prepping force layout with width height:');

    var fill = d3.scale.category20();
    var vis = d3.select("#chart")
        .on("mousedown", function() {
            //console.log("mousedown clicked");
            //d3.select("#infobox")
            //    .html(nodedump(Object.assign({}, json.details, json.params, source_counts)));
        });;
    
    if (navigator.userAgent.includes("Mozilla")) {
        var w = vis.property('width')['animVal']['value'],
            h = vis.property('height')['animVal']['value'];
    }
    else {
        var w = document.getElementById('chart').clientWidth,
            h = document.getElementById('chart').clientHeight;
    }

    console.log(w);
    console.log(h);
    
    if (w == 0) {
        w = 960;
        h = 500;
        console.log("Manually assigning width / height");
        console.log(w);
        console.log(h);
    }

    var r = 6,
        k = Math.sqrt(nodes.length / (w * h));


    var force = d3.layout.force()
        .size([w, h]).charge(-1 / k)
        .linkDistance(30);

    var link = vis.selectAll("line.link")
        .data(links).enter().append("svg:line").attr("class", "link")
        .style("stroke-width", function(d) { return Math.sqrt(d.value); })
        .attr("x1", function(d) { return d.source.x; })
        .attr("y1", function(d) { return d.source.y; })
        .attr("x2", function(d) { return d.target.x; })
        .attr("y2", function(d) { return d.target.y; });

    var nodehtml = function(d) {
        return "<h3>" + d.id + "</h3>";
    }

    var clickToggle = 0;
    var linkedByIndex = {};
    for (i = 0; i < nodes.length; i++) {
        linkedByIndex[i + "," + i] = 1;
    };
    links.forEach(function (d) {
        linkedByIndex[d.source.index + "," + d.target.index] = 1;
    });
    function neighboring(a, b) {
        return linkedByIndex[a.index + "," + b.index];
    }

    var tooltip = d3.select("body").append("div")
        .attr("class", "tooltip").style("opacity", 0);

    var node = vis.selectAll("circle.node")
        .data(nodes).enter().append("svg:circle")
        .attr("class", "node")
        .attr("cx", function(d) { return d.x; })
        .attr("cy", function(d) { return d.y; })
        .attr("r", 5)
        .style("fill", function(d) { return fill(d.group); })
        .call(force.drag)
        .on("mouseover", function(d,i) {
            d3.select(this).style("fill", "black");
            tooltip.transition().duration(200)
                .style("opacity", .9);
            tooltip.html(nodehtml(d))
                .style("left", (d3.event.pageX) + "px")
                .style("top", (d3.event.pageY - 28) + "px");
        })
        .on("mouseout", function(d,i) {
            d3.select(this).style("fill", fill(d.group));
            tooltip.transition().duration(200)
                .style("opacity", 0);
        })
        .on("mousedown", function(d,i) {
            d3.select(this).transition().delay(0).duration(1000).attr("r", 1.5 * r)
            .each("end", function() {
                d3.select(this).transition().duration(1000).attr("r", r);
            });
            //var infobox = d3.select("#infobox")
            //    .html(nodedump(d));
        })
        .on('dblclick', function(d,i) {
            //var infobox = d3.select("#infobox")
            //    .html(nodedump(d));
            if (clickToggle == 0) {
                //Reduce the opacity of all but the neighbouring nodes
                d = d3.select(this).node().__data__;
                node.style("opacity", function (o) {
                    return neighboring(d, o) | neighboring(o, d) ? 0.9 : 0.1;
                });
                link.style("opacity", function (o) {
                    return d.index==o.source.index | d.index==o.target.index ? 0.9 : 0.1;
                });
                //Reduce the op
                clickToggle = 1;
            } else {
                //Put them back to opacity=1
                node.style("opacity", 1);
                link.style("opacity", 1);
                clickToggle = 0;
            }
        });

    node.append("svg:title")
        .text(function(d) { return d; });

    vis.style("opacity", 1e-6)
        .transition().duration(1000).style("opacity", 1);

    force.on("tick", function() {
        link.attr("x1", function(d) { return d.source.x; })
            .attr("y1", function(d) { return d.source.y; })
            .attr("x2", function(d) { return d.target.x; })
            .attr("y2", function(d) { return d.target.y; });

        node.attr("cx", function(d) { return d.x = Math.max(r, Math.min(w - r, d.x)); })
            .attr("cy", function(d) { return d.y = Math.max(r, Math.min(h - r, d.y)); });
            //.attr("transform", function(d) { return "translate(" + d.x + "," + d.y + ") scale(0.30)"; });
    });

    force.nodes(nodes).links(links).start();
}


